import React from 'react';
import PropTypes from 'prop-types';
import Link from 'next/link';
const AppLayout = ({ children }) => {
	return (
		<div>
			<div>공통메뉴</div>
			{children}
		</div>
	);
};

AppLayout.proptype = {
	children: PropTypes.node.isRequired, //리턴안에 들어가는 모든 것들이 노드
};
export default AppLayout;
